import React from 'react'

import Card from '../../shared/components/UIElements/Card'
import './Auth.css'

const Auth = () => {
    return (
        <Card>
            <h2>Login Required</h2>
            <hr />
            <form></form>
        </Card>
    )
}

export default Auth
